column5:
Remove redundant test of vertical_whitespace

As it is now in `VerticalWhitespaceRuleTests`. Per code review from
@marcelofabri

Add failing non trigger example

```swift
func abc(
  a: String,
  bcd: String
) {
}
```

Add failing non trigger examples

```swift
func abc(
  a: String,  // comment
  bcd: String // comment
) {
}
```

add ReturnArrowWhitespaceRule

This rule checks whether you have 1 space before return arrow and return type

Good: func abc() -> Int {}
Bad:  func abc()->Int {}
